import Logo from "./Logo";
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <Logo />
      </header>
      <footer className="App=footer">
        Site Created and Maintained by <a href="https://www.linkedin.com/in/hollyrobillard/" target="_blank">Holly Robillard</a>
        Open Source Code on Github
      </footer>
    </div>
  );
}

export default App;
